    const [service, setService] = useState({
        detalle : "",
        valor : 0,
        estado : "Inactivo" });
    
    // const getServices = async ()=> {
    //     try {
    //     const response = await fetch("http://localhost:3001/add-service");
    //     const jsonResponse = await response.json();
    //     const ResponseServices = jsonResponse.data;
        

        

//     } catch(error) {
//         console.log(error);
//     }
// };

 function handleChange(e) {
    serService({
        [e.tajet.name]: e.target.value
    });
}       
    
    
    return (

        <Fragment>


            <h2 class="te">GESTIÓN DE SERVICIOS</h2>
            <div className="row">
                <div className="col ">
                    <a class="texti0 te0">Registro de Servicios</a>
                </div>
            </div>
            <hr class="lin"></hr>
            <div class="basic_info recuadro">
                <div className="row">
                    <div class="col drp">
                        
                    </div>
                    <div className="col">
                        <div class="input-group mb-3">
                            <input  type="text" class="form-control intu" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default " placeholder="Detalle" />
                        </div>
                    </div>
                </div>
                <div class="mb-3 row">
            <label for="inputNombre" class="col-sm-2 col-form-label valor" >Valor</label>
            <div class="col-sm-8">
                <input name = "titulo" onChange = {handleChange} type="number" class="form-control pesos" id="inputNombre"placeholder="$"/>
            </div>
            </div>
            <div class="mb-3 row">
            <div class="form-check radi">
                <input class="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault1"/>


                <label class="form-check-label" for="flexRadioDefault1">
                    Activo
                </label>
            </div>
            <div class="form-check radi">
                <label class="form-check-label" for="flexRadioDefault2">
                    No Activo
                </label>
                <input class="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault2" checked/>

            </div>
        </div>

            </div>
            <button type="button" class="btn btn-primary but2" data-bs-toggle="modal" data-bs-target="#staticBackdrop">Guardar</button>


